import React from 'react'

class Seaerching extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            searching:this.props.searching
        }
    }

    render(){
        return(
            <input type="text" placeholder="Search ..." id="search" /> 
        );
    }
}
export default Seaerching;
